webpackJsonp([0x617e88c2b0aa],{8427:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Plagerism",date:"30 Jan 2005",slug:"/2005-01-30-plagerism/",tags:"Y2005"},html:'<p>This can\'t be a coincidence. First ITW publishes the <a title="Industrial Technology & Witchcraft - das Weblog von TextLab" href="http://www.industrial-technology-and-witchcraft.de/index.php/ITW/13508/">healing hands of Siemens</a> the day after <a href="http://www.papascott.de/archives/2005/01/28/use-photoshop/">I already did</a>, then Nico plays <a title="Hoyzer und keine Ende - Verstrickung von Profis in die Affäre? [Lummaland - das Weblog]" href="http://lumma.de/eintrag.php?id=1206">plays bet-and-win with Hoyzer</a> the day after <a href="http://www.papascott.de/archives/2005/01/29/bet-win/">I already did</a>.</p>\n<p>Come on guys. Isn\'t it enough that we Americans invented both the internet and the weblog? Do you really have to steal our weblog posts as well?</p>'},next:{fields:{title:"Medienkritik Goes Deutsch",date:"30 Jan 2005",slug:"/2005-01-30-medienkritik-goes-deutsch/"}},previous:{fields:{title:"No Klum",date:"31 Jan 2005",slug:"/2005-01-31-no-klum/"}}},{node:{fields:{title:"Medienkritik Goes Deutsch",date:"30 Jan 2005",slug:"/2005-01-30-medienkritik-goes-deutsch/",tags:"Y2005"},html:'<p>Interesting... David and RayD, the folks behind Davids Medienkritik, are planning <a title="Davids Medienkritik: Our Goal for 2005: A New German-Language Blog/Unser Ziel für 2005: Ein neues, deutschsprachiges Blog" href="http://medienkritik.typepad.com/blog/2005/01/our_goal_for_20.html">a new German-language blog</a>, and thay hope to attract the attention of the German public with mainstream advertising. Blogging, politics, mainstream press, advertising? I just happen to know that <a href="http://lumma.de/">Nico Lumma</a> is expert for all of those, and he just happens to be my new boss. Nico\'s political heart beats deep red, but you may want to give him a call anyway.</p>'},next:{fields:{title:"I Fear No Evil",date:"30 Jan 2005",slug:"/2005-01-30-i-fear-no-evil/"}},previous:{fields:{title:"Plagerism",date:"30 Jan 2005",slug:"/2005-01-30-plagerism/"}}},{node:{fields:{title:"I Fear No Evil",date:"30 Jan 2005",slug:"/2005-01-30-i-fear-no-evil/",tags:"Y2005"},html:"<p>I could ask today what operation is more dangerous, guarding a polling place for the Iraqi election, or supervising a carload of 5-year-olds for Christopher's <a href=\"http://www.fuxis.de/\">birthday party</a>. But such a question would be crude, rude and politcally totally incorrect.</p>\n<p>I'm not wearing any body armour, I like living on the edge.</p>"},next:{fields:{title:"Bet & Win",date:"29 Jan 2005",slug:"/2005-01-29-bet-win/"}},previous:{fields:{title:"Medienkritik Goes Deutsch",date:"30 Jan 2005",slug:"/2005-01-30-medienkritik-goes-deutsch/"}}}],pathPrefix:"",first:!1,last:!1,index:349,pageCount:1101}}}});
